CREATE DEFINER=`root`@`localhost` PROCEDURE `fill_time_dimension`()
BEGIN
	DECLARE year INT;
	DECLARE month INT;
	DECLARE day INT;

	DECLARE year_name TEXT;
	DECLARE month_name TEXT;
	DECLARE day_name TEXT;

	DECLARE d_year_id BIGINT;
	DECLARE d_month_id BIGINT;
	DECLARE d_day_id BIGINT;

	DECLARE ro_year_id BIGINT;
	DECLARE ro_month_id BIGINT;
	DECLARE ro_day_id BIGINT;

	INSERT INTO dimension (name) VALUES ('Jahr');
	SET d_year_id = LAST_INSERT_ID();
	INSERT INTO dimension (name) VALUES ('Monat');
	SET d_month_id = LAST_INSERT_ID();
	INSERT INTO dimension (name) VALUES ('Tag');
	SET d_day_id = LAST_INSERT_ID();

	INSERT INTO dimension_hierarchy (parent_id, child_id) VALUES (d_year_id, d_month_id);
	INSERT INTO dimension_hierarchy (parent_id, child_id) VALUES (d_month_id, d_day_id);

	SET year = 2012;
	WHILE year <= 2014 DO
		SET year_name = year;
		INSERT INTO reference_object (dimension_id, name) VALUES (d_year_id, year_name);
		SET ro_year_id = LAST_INSERT_ID();

		SET month = 1;
		WHILE month <= 12 DO
			SET month_name = CONCAT_WS('/', LPAD(month, 2, '0'), year_name);
			INSERT INTO reference_object (dimension_id, name) VALUES (d_month_id, month_name);
			SET ro_month_id = LAST_INSERT_ID();
			INSERT INTO reference_object_hierarchy (parent_id, child_id) VALUES (ro_year_id, ro_month_id);

			SET day = 1;
			WHILE day <= DAY(LAST_DAY(CONCAT_WS('-', year, month, 1))) DO
				SET day_name = CONCAT_WS('/', LPAD(day, 2, '0'), month_name);
				INSERT INTO reference_object (dimension_id, name) VALUES (d_day_id, day_name);
				SET ro_day_id = LAST_INSERT_ID();
				INSERT INTO reference_object_hierarchy (parent_id, child_id) VALUES (ro_month_id, ro_day_id);

				SET day = day + 1;
			END WHILE;
			SET month = month + 1;
		END WHILE;
		SET year = year + 1;
	END WHILE;
END ;;
DELIMITER ;
